import React from 'react';
import './Header.css'; // Импорт стилей

const Header = () => {
  return (
    <header>
      <div className="header-content">
        <h1>Авто сайт</h1>
        <div className="auth-links">
          <a href="#">Регистрация</a>
          <span> | </span>
          <a href="#">Войти</a>
        </div>
      </div>
      <Navigation />
    </header>
  );
};

export default Header;
